import "./Document.css";
// Importation des bibliothèques nécessaires



const Document = ({titre}) => {
    return (
        <>
            <div className="card">
                <img
                    src={require("./public/images/document-icon-18.png")}
                    alt="document"
                />
                <p>{titre}</p>
            </div>
        </>
    );
}

export default Document;
